import React, { useState, useEffect } from 'react';

function Result() {
    const [ getResult ] = useState(null);
    useEffect(() => {
        fetch("http://localhost:8000/main")
            .then((res) => {
                return res.json();
            })
            .then(data => {
                getResult(data);
            });
        }, []);
    return (
        // BN으로부터 인공지능 돌린 결과 가져와서 출력해야함!
        <div className='result__container'>
            {}
        </div>
    );
}

export default Result;
